#!/usr/bin/python3

import ctypes

# 加载.so文件
lib = ctypes.cdll.LoadLibrary('./libdtparser.so')
# print('lib.so file loaded')
# b=lib.test(10)
# print("b,", b)
# 定义函数原型
lib.prs_dt.restype=ctypes.c_char_p

out_buf = ctypes.create_string_buffer(2048)
# 调用函数
result = lib.prs_dt("",out_buf)
